import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import './ChatUi.css'


const myChats = [
  {
    name: 'Mark chat',
    id: '1',
  },

  {
    name: 'Rodion chat',
    id: '2',
  },
];

export const ChatUi = () => {

  return (
    <List>
      {myChats.map((c) => {

        <ListItem key={c.id}>
          {c.name}
        </ListItem>
      })}
      
    </List>
  );
}
